// src/App.js
import React from 'react';
import Header from './components/Header';
import ContactForm from './components/ContactForm';
import MapSection from './components/MapSection';
import Footer from './components/Footer';
import './App.css';

function App() {
    return (
        <div className="App">
            <Header />
            <ContactForm />
            <MapSection />
            <Footer />
        </div>
    );
}

export default App;
